CREATE DATABASE sales;
USE SALES;

CREATE TABLE customers
(first_name varchar(50), 
last_name varchar(50), 
phone varchar(50), 
email varchar(50), 
street varchar(50), 
city varchar(50), 
state varchar(50), 
zip_code INT
);


CREATE TABLE ORDERS
(
order_id INT, 
customer_id INT, 
order_status VARCHAR(25), 
order_date DATE, 
required_date DATE, 
shipped_date DATE, 
store_id INT,
staff_id INT
);


CREATE TABLE staffs
(
staff_id INT PRIMARY KEY, 
first_name VARCHAR(25), 
last_name VARCHAR(25), 
email VARCHAR(50), 
phone VARCHAR(25), 
active int, 
store_id int, 
manager_id int
);




CREATE TABLE STOCKS
(store_id int, 
Product_id int, 
Quantity int
)
;

